import {
  all,
  fork,
  call,
  take,
  put,
  delay,
  debounce,
  throttle,
  takeLatest,
  takeEvery,
  takeLeading,
  takeMaybe,
} from "redux-saga/effects";
import axios from "axios";
import postSaga from "./post";
import userSaga from "./user";

export default function* rootSaga() {
  // fork 와 call 은 다름
  yield all([fork(postSaga), fork(userSaga)]);
}
